import React, { useState } from 'react';
import './Climb.css';


const Climb = ({climbList}) => {

    return climbList.map((climb, index) => (
        <div className='climb-instance'>
          {climb.gym}
          {climb.climbType}
          {climb.grade}
          {climb.rating}
        </div>
      ));



};

export default Climb;
